import Foundation

final class URLSessionMockProvider: ProviderProtocol {
    private var session: URLSessionProtocol
    
    init(session: URLSessionProtocol = URLSession.shared) {
        self.session = session
    }
    
    func request<T>(type: T.Type, service: ServiceProtocol, completion: @escaping (NetworkResponse<T>) -> ()) where T: Decodable {
        
        var cityData: Data? = nil
        if let lat = service.parameters["lat"], let lon = service.parameters["lon"] {
            if lat.hasPrefix("50.") && lon.hasPrefix("14.") {
                cityData = getJsonPrague()
            } else if lat.hasPrefix("40.") && lon.hasPrefix("-74.") {
                cityData = getJsonNewYork()
            }
        }
        
        guard let data = cityData, let model = try? JSONDecoder().decode(T.self, from: data) else { return completion(.failure(.unknown)) }
        completion(.success(model))
    }
    
